export default (state = {}, { type, payload }) => {
    switch (type) {
      case 'SET_USER':
        return payload;
      case 'CLEAR_USER':
        return {};
      case 'SET_User_LIST_RESPONSE':
        return {
          ...state,
          UserListResponse : payload
        }
      default:
        return state;
    }
  };
